import React from 'react';

function Job(props) {
    return(
        <div className="jobRow">
            <div className="leftJob"> 
                {props.company}
                {props.time}
            </div>
            <div className="rightJob">
                {props.location}
            </div>
        </div>
    );
}

export default Job;
